import React from "react";
import "./style.css";
import chandra_mohan from '../images/avtar.png';


function Myheader() {
  return (
    <div>
       <ul className="novbar">
        <li>Home</li>
        <li>About Us</li>
        <li>Blog</li>
        <li>Contact Us</li>
       </ul>
       <img src={chandra_mohan} alt=""/>
    </div>
  );
}

export default Myheader;
